{"query":"query {
	SelectObjectEvents {
		ObjectEvents(
			Is: {
				Select: {
					Function: {
						Periodicity: {
							Interval: "1 Hour"
							From: { Attribute: { Id: { In: ["Epoch"] } } }
						}
					}
					As: { In: "Hours" }
					And: {
						Attribute: { Id: { In: ["Status"] } }
						And: { Attribute: { Id: { In: ["Assignee"] } } }
					}
				}
				From: { Object: { Label: { In: "Client Jira Object 1" } } }
				Where: {
					Filter: {
						Condition: { Date: { GreaterThanOrEqual: "2 weeks ago" } }
						From: { Attribute: { Id: { In: ["Epoch"] } } }
					}
				}
				#	# New Behaviors
				#  	* Limit
				#  	* Offset
				#  	* OrderBy
				#  	* Having
				# 	* Join
			}
		)
	}
}
","operationName":"Operations"}

